using Microsoft.VisualStudio.TestTools.UnitTesting;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Tests
{
    [TestClass()]
    public class SolutionTests_NumDistinctTest
    { 

        [TestMethod()]
        public void NumDistinctTest()
        {
            Assert.AreEqual(3, new Solution().NumDistinct("ccc", "c"));

            Assert.AreEqual(3, new Solution().NumDistinct("rabbbit", "rabbit"));
            Assert.AreEqual(630, new Solution().NumDistinct("rabbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbit", "rabbit"));

            Assert.AreEqual(1456742400, new Solution().NumDistinct("",
"rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys"));
        }
    }
}